class BookingListingService extends payment_service.Token {
    async getExposedGuestBookings(params) {
        const token = this.getToken();
        if (!token) {
            throw new payment_service.MissingTokenError();
        }
        const { data } = await payment_service.axios.post(`/Get_Exposed_Guest_Bookings?Ticket=${token}`, Object.assign(Object.assign({}, params), { extras: [
                {
                    key: 'payment_code',
                    value: '',
                },
                {
                    key: 'prepayment_amount',
                    value: '',
                },
            ] }));
        if (data['ExceptionMsg'] !== '') {
            throw new Error(data['ExceptionMsg']);
        }
        return { bookings: data['My_Result'], total_count: data['My_Params_Get_Exposed_Guest_Bookings'].total_count };
    }
}

